import React, { Component } from "react";
import Link from "next/link";
import Layout from "../components/Layout/Layout";
export default class jobscategory extends Component {
  homeHandler = () => {
    console.log("clicked");
  };
  render() {
    return (
      <Layout>
        <Link href="/">
          <a>Back to home</a>
        </Link>
        {/* <button onClick={this.homeHandler}>Go to Home</button> */}
      </Layout>
    );
  }
}
